import {Link} from "react-router-dom";

function Nav(){
    return(
        <div className="nav">
            <ul>
                <li><Link to='/'>Intro</Link></li>
                <li><Link to='/profile'>Profile</Link></li>
                <li><Link to='/idea'>Idea</Link></li>
                <li>< Link to='/capabilities'>Capabilities</Link></li>
            </ul>
        </div>
    )
}

export default Nav;
